import styles from './index.module.sass';

export default function Logo({ size, hasText }) {
	const sizes = {
		xs: 'logo-extrasmall',
		s: 'logo-small',
		m: 'logo-medium',
		l: 'logo-large',
	};
	const logoSize = sizes[size] || sizes['s'];

	return (
		<div
			className={`${styles.logo} ${hasText && styles.logo_hastext} ${
				styles[logoSize]
			}`}>
			<LogoSVG width='100px' color='#526245' />
		</div>
	);
}

